    /**
     * @author: wangyulong
     * @datetime: 2019-07-16 14:31
     * @param: [targetString]
     * @return:
     * @description: 无重复字符的最长子串
     */
    public static int longestSubstring(String targetString) {
        int len = 0;
        char[] chars = targetString.toCharArray();
        for (int i = 0; i < chars.length; i++) {
            String temp = "" + chars[i];
            if (targetString != null && targetString.length() > 1) {
                for (int j = i + 1; j < chars.length; j++) {
                    if (!temp.contains("" + chars[j])) {
                        temp = temp + chars[j];
                        len = temp.length() > len ? temp.length() : len;
                    }else{
                        len = temp.length() > len ? temp.length() : len;
                        temp = "";
                        break;
                    }
                }
            }else {
                len = temp.length();
            }
        }
        return len;
    }

